import React,{Component} from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link,browserHistory} from "react-router-dom";
import { Icon} from 'semantic-ui-react'
import 'semantic-ui/dist/semantic.min.css';



class Managerheader1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id:this.props.mid
        }
    }
    componentDidMount(){
        console.log
    }
     onLogoutClic(){
        localStorage.clear();
        window.location="/login"
    }
    render() {

        const id=this.props.mid
        function onItemClick(){
            console.log(id)
            this.props.history.push= ("/manager"+"/"+ id)

        }
        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div className="header">
                        <Link onClick={onItemClick} > <img   src={NINE} alt="nineleaps"/> </Link>

                        <Link onClick={onItemClick } style={{marginLeft:"650px"}} > <Icon name='home' />   Home</Link>

                           <Link onClick={this.onLogoutClic} style={{marginInlineStart:"left"}}> <Icon name='sign-out' /> Logout</Link>

                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Managerheader1
